import React from 'react';
import {Container, Form, Input} from 'semantic-ui-react';
import {AuthStyle} from '../styled/theme';
const Login = () => {
	let error ='this is an error message';
	return(
		<AuthStyle>
			<h3>Login</h3>
			<Container>
				<Form>
					<Form.Field
						id="email"
						control={Input}
						label = "email"
						placeholder="email address"
						type="email"
					/>
					<Form.Field
						id="password"
						control={Input}
						label = "password"
						placeholder="password"
						type="password"
						error={error}
					/>
				</Form>
			</Container>
		</AuthStyle> 
	);
};

export default Login;
